import '../App.css';

import arrowIcon from "../images/arrow.png"
function Arrow() {
    const goToProjects = () => {
        window.location.href = './#projects';
    }

    return (

        <img src={arrowIcon} alt="arrow" className='icon-arrow' onClick={goToProjects} />

    );
}

export default Arrow;
